import React from 'react';
import { BrowserRouter as Router, Routes, Route, Navigate } from 'react-router-dom';

import SideNavigation from './components/SideNavigation'; // Import SideNavigation component
import StudentDashboard from './pages/StudentDashboard'; // Import StudentDashboard component
import Login from './pages/Login'; // Example login page (optional, if needed)
import Home from './pages/Home'; // Example home page
import Search from './pages/Search'; // Other pages
import Applications from './pages/Applications';
import Visa from './pages/Visa';
import Countries from './pages/Countries';
import Community from './pages/Community';
import Settings from './pages/Settings';
import Help from './pages/Help';

const App = () => {
  // For simplicity, we can assume authentication status here (in a real app, use state or context)
  const isAuthenticated = true;

  // Protected Route wrapper for pages that require authentication
  const PrivateRoute = ({ children }) => {
    return isAuthenticated ? children : <Navigate to="/login" />;
  };

  return (
    <Router>
      <div className="flex min-h-screen">
        {/* Render SideNavigation for all authenticated pages */}
        {isAuthenticated && (
          <div className="w-[15%]">
            <SideNavigation />
          </div>
        )}

        {/* Main Content Area */}
        <div className="flex-1">
          <Routes>
            {/* Public Route for Login */}
            <Route path="/login" element={<Login />} />

            {/* Protected Routes */}
            <Route
              path="*"
              element={
                <PrivateRoute>
                  <Routes>
                    <Route path="/" element={<StudentDashboard />} />
                    <Route path="/search" element={<Search />} />
                    <Route path="/applications" element={<Applications />} />
                    <Route path="/visa" element={<Visa />} />
                    <Route path="/countries" element={<Countries />} />
                    <Route path="/community" element={<Community />} />
                    <Route path="/settings" element={<Settings />} />
                    <Route path="/help" element={<Help />} />
                  </Routes>
                </PrivateRoute>
              }
            />
          </Routes>
        </div>
      </div>
    </Router>
  );
};

export default App;
